var db = new PouchDB('http://localhost:5984/_users');

var overlays = {
	killOverlays: function(){
		routedetails.destroy();
	},

	loadOverlay: function(id){
		var el = document.getElementById(id);
		var clone = document.importNode(el.content, true);
		document.body.appendChild(clone);		
	}
}

function passwordViewModel(attributes) {
    this.data = {
        passhidden: false,
        att: attributes,
    }

    this.hidepassword = function (e, scope) {
        scope.data.passhidden = !scope.data.passhidden;
    };
    
}

rivets.components['password'] = {
    static:['placeholder'],

    template: function() {
        var template = '<input type="password" class="field_text" rv-value="data.att.val.value" rv-show="data.passhidden" placeholder="Password"/><input type="text" rv-value="data.att.val.value" rv-hide="data.passhidden" class="field_text" placeholder="Password"/><button class="password-toggle-vis button--icon_small button--transparent_grey" rv-on-click="hidepassword"><i class="icon-eye" rv-show="data.passhidden"></i><i class="icon-eye_closed" rv-hide="data.passhidden"></i></button>';
        return template;
    },

    initialize: function(el, attributes) {
        return new passwordViewModel(attributes);
    }
}; 

function textInputViewModel(attributes) {
    this.data = attributes;

    this.manageinput = function(e,scope){
        if(typeof  scope.data.val.value == "undefined" || scope.data.val.value == "") $(e.currentTarget).addClass('s-error');
    	else $(e.currentTarget).removeClass('s-error');
    }
}

rivets.components['textinput'] = {
	static:['placeholder'],

    template: function() {
        var template = '<input class="field_text" type="text" rv-on-keyup="manageinput" rv-placeholder="data.placeholder" rv-value="data.val.value"><br/>';
        return template;
    },

    initialize: function(el, attributes) {
    	return new textInputViewModel(attributes);
    }
}; 
 

function emailInputViewModel(attributes) {
    this.data = {
    	att: attributes,
    	invalid: false
    };

    this.manageinput = function(e,scope){
    	var re = /\S+@\S+\.\S+/;
		if (scope.data.att.val.value == '' || !re.test(scope.data.att.val.value)){
			scope.data.invalid = true;
		}else{
			scope.data.invalid = false;
		}
    }
}

rivets.components['emailinput'] = {
	static:['placeholder'],

    template: function() {
        var template = '<input class="field_text" type="email" rv-placeholder="data.att.placeholder" rv-class-s-error="data.invalid" rv-on-keyup="manageinput" rv-value="data.att.val.value"><div class="field--error" rv-show="data.invalid">Are you sure about that e-mail address?</div>';
        return template;
    },

    initialize: function(el, attributes) {
    	return new emailInputViewModel(attributes);
    }
}; 

var signin = {
	settings: {
		username: {
			value: ""
		},
		password: {
			value: ""
		},
		showpassword: true,
		loginerror:{
			haserror: false,
			messge: "",
		},
	},

	init: function(){

	},

	signMeIn: function(username, password){
		db.login(username, password)
			.then(function(response){
				return db.getUser(username);
			}).then(function(response){
				console.log(response);
				window.location.href = "/" + response.usertype + ".html";
			})
			.catch(function(err){
				signin.settings.loginerror.haserror = true;
				signin.settings.loginerror.message = err.message;
			});
	},

	controller: {
		signin: function(e,model){
			signin.signMeIn(model.signin.username.value, model.signin.password.value);
		},

		showSignin: function(){
			signin.visible = true;
		},

		errorClear: function(e,model){
			model.signin.loginerror.haserror = false;
		},

	}
}

rivets.bind($('.js--signin'),{
	signin: signin.settings,
	signincontroller: signin.controller
});

