rivets.formatters.gradeconversion = function(value, type){
	if(typeof type =="undefined" || typeof value == "undefined") return 0;
	if(type == 'boulder') {
		if(typeof boulderGrades[value] == 'undefined') return boulderGrades[boulderGrades.length-1];
		return boulderGrades[value].vgrade;
	}
	else{
		if(typeof sportGrades[value] == 'undefined') return sportGrades[sportGrades.length-1];
		return sportGrades[value].yds;
	}
};

rivets.binders.checkfirst = function(el, value){
	if(value === 0) $(el).attr("checked","checked"); 
};

rivets.formatters.lengthToBool = function(value){
	if(typeof value == 'undefined') return false;
	if(value.length === 0) return false;
	return true;
};

rivets.formatters.lengthofObject = function(value){
	if(typeof value == 'undefined') return 0;
	return value.length;
};

rivets.formatters.gradesoftype = function(value){
	if(typeof value == "undefined") return 0;
	if(value == 'boulder') return boulderGrades.length - 1;
	else return sportGrades.length - 1;
};

rivets.formatters.compare = function(value, comparison){
	if(typeof value != 'undefined' || value === comparison) return true;
	else return false;
};

rivets.formatters.qrcodeToImage = function(value){
	if(typeof value != "undefined") return "data:image/png;base64," + value;
};

var createUser = {
	settings: {
		visible: false,
		username:{
			value:""
		},
		password:{
			value:""
		},
		email:{
			value:""
		},
		userTypes:[
			"Customer",
			"Employee"
		],
		userType: "Customer",
		saving: false,
		error: {
			haserror: false,
			message: ""
		},
		qrcode: '',
	},

	init: function(){
		overlays.loadOverlay("createuseroverlay");

		rivets.bind($('.js--createUser'),{
			createuser: createUser.settings,
			createusercontroller: createUser.controller
		});

		setTimeout(function(){
			$('.js--createUser').addClass('s-visible');	
		}, 1);
	},

	destroy: function(){
		$('.js--createUser').removeClass("s-visible");
		setTimeout(function(){
			$('.js--createUser').remove();
		},500);
		createUser.settings.saving = false;
		
	},

	generateQRCode: function(id){
		var qr = new QRious({
		  value: id,
		  size: 1000,
		})

		return qr.toDataURL().split(",")[1];
	},

	controller: {
		showCreateModal: function(e,model){
			model.createuser.visible = true;
		},
		
		createUser: function(e,model){
			model.createuser.saving = true;
			var qr = createUser.generateQRCode(model.createuser.username.value);

			db.signup(model.createuser.username.value, model.createuser.password.value,{
				metadata: {
					email : model.createuser.email.value,	
					sends : [],
					qrcode : qr,
					usertype: model.createuser.userType
				}

			}).then(function(response){
				return db.login(model.createuser.username.value, model.createuser.password.value);
			}).then(function(response){
				signin.signMeIn(model.createuser.username.value, model.createuser.password.value);
			}).catch(function(err){
				model.createuser.saving = false;
				model.createuser.error.haserror = true;
				model.createuser.error.message = err.message;
				console.log(err);
			});
		},

		cancelCreateUser: function(e,model){
			createUser.destroy();
		}, 

		makeQRCode: function(e,model){
			createUser.generateQRCode(model.createuser.username.value);
		},

		setUserType: function(e,model){
			createUser.settings.userType = e.currentTarget.value;
		}
	}
}


